import React from 'react';
import './Navbar.css';



function Navbar(){
    return (
        <aside>
            <nav>
            <path d="M24.0655 1.39844L14.5703 10.9021H24.0655V1.3984  4Z" class="stroke-super dark:stroke-superDark group-hover:stroke-superDuper transition-colors duration-300 stroke-[1.3px] transition-all duration-300" stroke-miterlimit="10"></path>
                <ul>
                    <li><a>New Thread</a></li>
                    <li><a>Home</a></li>
                    <li><a>Discover</a></li>
                    <li><a>Library</a></li>
                    <li><a>Login</a></li>
                    <li><a>Signup</a></li>
                </ul>   
            </nav>
        </aside>
    );
}

export default Navbar;
